INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('David Proval', '1942-05-20', 'Brooklyn, New York, USA', 'nm0698998', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjAxNjc4NDg2MF5BMl5BanBnXkFtZTcwNTA1NzE3MQ@@._V1_.jpg', 'David Proval launched his acting career with a starring role in "Mean Streets", directed by Martin Scorsese, and has been working nonstop ever since. Notable features in which he has appeared include "The Phantom", "The Brady Bunch Movie" "Four Rooms" and "The Shawshank Redemption".');
