INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Jude Ciccolella', 'Unknown', 'Burlington, Vermont, USA', 'nm0161980', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjA4NzY2NzAzOV5BMl5BanBnXkFtZTcwMDc2OTkyMQ@@._V1_.jpg', 'Jude was born in Burlington Vermont on March 11th, 1947. He spent his first three years in Middlebury Vermont where his father coached Football, Basketball and Baseball at Middlebury College. He then moved to Albany, New York, his hometown, where he would spend his formative years.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Paul McCrane', '1961-01-19', 'Philadelphia, Pennsylvania, USA', 'nm0005204', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTI2Mjc1NzExN15BMl5BanBnXkFtZTYwNjUzMzQz._V1_.jpg', '');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Renee Blaine', 'Unknown', '', 'nm0086169', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Renee C. Blaine. Renee was born in Milwaukee, Wisconsin, but her family\'s ties to the mountains of Colorado drew them back when she was 3 years old. It was here that she began her career as a fashion model in the mid 1980\'s, appearing in Self, Ski and Mademoiselle Magazines in ads for Rayban, Obermeyer and Justin Boots.');
