INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Alfonso Freeman', '1959-09-13', 'Los Angeles, California, USA', 'nm0293285', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjE1NDg3ODk4MV5BMl5BanBnXkFtZTcwNzM2NTUzMQ@@._V1_.jpg', 'Alfonso was born at County General hospital in Los Angeles, September 13, 1959 to Morgan Freeman and Loletha Adkins (Polk) and grew up in Compton, California. He briefly attended Cal State University-Long Beach as an Art Major. Alfonso did not meet his famous father in person until 1984, when he came to L.');
INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('V.J. Foster', 'Unknown', '', 'nm0288106', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTQ5Mzg4ODQyMl5BMl5BanBnXkFtZTgwNjQ4MDA1MjE@._V1_.jpg', 'A founding member and the former Associate Artistic Director of The Actors\' Gang, the Los Angeles based theater ensemble, VJ is a cast member in a touring production of a world premiere adaptation of George Orwell\'s 1984. VJ\'s travels with the Actors\' Gang include stops in London, Hong Kong, Buenos Aires, Madrid, Edinburgh, Athens, Melbourne, and Barcelona as well as extended runs at the Public Theater in New York City.');
