INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Thomas Pasatieri', '1945-10-20', 'New York City, New York, USA', 'nm0664225', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Aside from his work with film scores, Thomas Pasatieri is well known in the classical world as a composer and conductor. He was quite prolific from a young age, studying with Nadia Boulanger. He attended the Juilliard School, where he was the first to graduate with a doctorate.');
