INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Tom Boyd', 'Unknown', '', 'nm2036352', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'The incredibly wide and diverse audience that Tom Boyd reaches through his oboe performances on over 1400 motion picture film scores makes him one of the most heard oboe players on the planet today. Mr. Boyd attended The Julliard School and shortly thereafter won the Principal Oboe position in The Honolulu Symphony at the age of 21.');
