INSERT IGNORE INTO People(pTitle, pBirthday, pBirthPlace, peopleId, pImageUrl, pDescription) VALUES('Frank Macchia', 'Unknown', '', 'nm0531488', 'http://ia.media-imdb.com/images/G/01/imdb/images/nopicture/medium/name-2135195744._CB522736367_.png', 'Born and raised in San Francisco, California, Frank started on the clarinet at the age of ten years old. Soon afterward he began studies on bassoon, saxophone and flute. By the age of fourteen he began studying composition, writing jazz and classical pieces for his high school band and orchestra and for jazz ensembles that rehearsed at the local union hall, including trumpeter Mike Vax\'s Big Band.');
